    text:
    - 文化馆内，一群男孩正坐在地上休息，指导老师金明告诉记者，他们正排练的节目是30个男子一起表演的集体舞，通过舞蹈展现淮河之畔男子刚毅的个性。队长李跃告诉记者，这次节会规模大、任务重、时间紧。但是，在团十年、经历了历届花鼓灯节会的李跃显得颇为轻松。而对于14岁的潘星宇来说，压力是颇大的，一脸稚气的他告诉记者这是自己第一次参加，心里很紧张。郑军是花鼓灯表演场上的老演员了，他自己也开玩笑地说整个表演队里就属他最大，与李跃一样，他的参演经历也很丰富，此次节会中他将表演群舞、鼓舞春晓等4个节目。他说正排练的男子群舞名称不便透露，但是编导别出心裁，将普通劳动者的生活场景提炼出来编入舞蹈，要让淮河汉子的形象深入人心。
